package com.einstein.files.EiFiles;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.ResponseBody;

import javax.servlet.http.HttpServletRequest;


@Controller
@SpringBootApplication
@RequestMapping("/")
public class EiFilesApplication implements CommandLineRunner {

    private final
    S3Services s3Services;

    @Autowired
    public EiFilesApplication(S3Services s3Services) {
        this.s3Services = s3Services;
    }

    public static void main(String[] args) {
        SpringApplication.run(EiFilesApplication.class, args);
    }


    @RequestMapping(value = "/uploadImage", method = RequestMethod.POST)
    public @ResponseBody
    String uploadImage(@RequestParam("imageName") String imageName,
                       @RequestParam("imageValue") String imageValue,
                       HttpServletRequest request) {
        try {
            s3Services.uploadFile(imageName, imageValue);
            return "success ";
        } catch (Exception e) {
            return "error = " + e;
        }
    }

    @RequestMapping(value = "/uploadImage", method = RequestMethod.POST)
    public @ResponseBody
    String uploadImage(
            @RequestParam("imageValue") String imageValue,
            HttpServletRequest request) {
        try {
            s3Services.uploadFile("1.jpg", imageValue);
            return "success ";
        } catch (Exception e) {
            return "error = " + e;
        }
    }

    @RequestMapping(value = "/", method = RequestMethod.GET)
    public @ResponseBody
    String index() {
        try {
            return "Welcome to Einstein Files";
        } catch (Exception e) {
            return "error = " + e;
        }

    }

    @RequestMapping(value = "/getzipurl", method = RequestMethod.POST)
    public @ResponseBody
    String uploadImage2(@RequestParam("imageName") String imageName,
                        HttpServletRequest request) {
        try {
            return s3Services.getURL(imageName);
//            return "success ";
        } catch (Exception e) {
            return "error = " + e;
        }

    }

    @Override
    public void run(String... args) {

        // String url = s3Services.getURL("1.jpg");
        //  System.out.println(">>>>> URL ? " + url);

//Upload file
        s3Services.uploadFile("one.jpg", "");


//download File
//        s3Services.downloadFile("score.jpg");
    }
}
